static void print_instruction(Instruction* instr){
    printf("%s: ", NMEMONIC_TABLE[instr->instr]);
    for(int i = 0; i < instr->size; i++) printf("%02x ", instr->bytes[i]);
    printf("\nOperand 1: %s\n", operand_to_string(instr->op1));
    printf("Operand 2: %s\n", operand_to_string(instr->op2));
    printf("Operand 3: %s\n", operand_to_string(instr->op3));
    printf("Opcode Extension: %i\n", instr->digit);
    printf("Immediate Byte: %i\n", instr->ib);
    printf("Modrm contains Reg: %s\n", ((instr->r & 0x1) != 0) ? "true" : "false");
    printf("Add Register to Opcode: %s\n", ((instr->r & 0x2) != 0) ? "true" : "false");
    printf("Uses 2 byte Vex: %s\n", ((instr->r & 0x8) != 0) ? "true" : "false");
    printf("Uses 3 byte Vex: %s\n", ((instr->r & 0x10) != 0) ? "true" : "false");
    printf("Rex Prefix: %i\n", instr->rex);
}
